package ru.fit.app.presentation.navigationimport com.arkivanov.decompose.router.stack.StackNavigationimport com.arkivanov.decompose.router.stack.bringToFrontimport com.arkivanov.decompose.router.stack.popimport ru.fit.app.features.profile.presentation.ProfileNavigationimport ru.fit.app.presentation.RootComponent.Configclass ProfileNavigationImpl(	private val router: StackNavigation<Config>) : ProfileNavigation {	override fun navigationListProgress() {		router.bringToFront(Config.ListProgress)	}	override fun back() {		router.pop()	}}